import  { useState ,useEffect } from 'react';
import  ApiCaller from './../Utils/ApiCaller';
import  *  as Message from './../constants/Message';


function Cartactive() {
const [data, setData] = useState([]);
      useEffect( () => {
       ApiCaller('Cart','Get',null)
        .then( (res) => {
          setData(res.data)
        });
      });
      useEffect( () => {
        let result = Message.MSG_CART_EMPTY;
        if(data.length > 0) {
            result =  setData.map((item,index) => {
                return (
                    <div className="product-new">
                    <div className="product__header">
                      <img src={item.img} alt="" className="product__header-img" />
                      <div className="product__header-evaluate" />
                    </div>
                    <div className="product__title">
                      <h3 className="product__title-heading">trung {item.name}</h3>
                      <h2 className="product__title-price">${item.price}</h2>
                    </div>
                  </div>
                );
            });
        }
      },[data])

      }

export default Cartactive;
